		selectionChanged(params) {
   			// params.selectedRows - all rows that are selected (this page)
			console.log(JSON.stringify(params.selectedRows))
  		},
		toggleGroupBy: function(state) {
			if (this.isGroupedTable === false) {
				this.isGroupedTable = true
				this.tableData = this.table.rows
				this.table.rows = this.groupby(this.table.rows,this.groupField,this.sortField)
			} else {
				this.isGroupedTable = false
				this.table.rows = this.tableData
				this.table.columns.filter(x => x.field === this.groupField).length > 0 ? this.table.columns.filter(x => x.field === this.groupField)[0].hidden = false : ''
			}						
		}, 
		groupby: function (array, groupField, sortField) {
			// group by field for data
			if (array.length === 0 ) { return false }
			var groups = {}; // This object will end being keyed by groups, and elements will be arrays of the rows within the given array, which have been sorted by the sortField
			// Put all the rows into groups
			for (var i = 0; i < array.length; i++) {
				var row = array[i]
				var groupValue = row[groupField]
				groups[groupValue] = groups[groupValue] || []
				groups[groupValue].push(row)
			}
			// Sort each group
			for (var groupValue in groups) {
				groups[groupValue] = groups[groupValue].sort(function(a, b) {
				return a[sortField] - b[sortField]
				})
			}

			const final = []
			for (const key in groups) {
				final.push({
					mode: 'span', // span means this header will span all columns
    				label: key, // this is the label that'll be used for the header
					score:  groups[key].reduce(function(prev, cur) { return prev + cur.score }, 0),
    				html: false,					
					children: groups[key]
				})
			}

			// Return the results
			this.table.columns.filter(x => x.field === groupField).length > 0 ? this.table.columns.filter(x => x.field === groupField)[0].hidden = true : ''
			return final			
		},
		sumCount: function (rowObj) {
    		console.log(rowObj)
    		let sum = 0
    		for (let i = 0; i < rowObj.children.length; i++) {
      			sum += rowObj.children[i].count
			}
    		return sum
  		},		
	},
	computed: {
		groupOptions () {
			return this.isGroupedTable ? { enabled: this.isGroupedTable, collapsable: true } : {}
		} 
	},	
	mounted () {		
		if (this.isGroupedTable) {
			this.table.rows = this.groupby(this.table.rows,'name','age')
		} else {
			this.table.rows = this.table.rows
		}
	}	
}

